import React from 'react';
import '../../css/Logbook.css';
import { Link } from 'react-router-dom';

class Logbook extends React.Component {
    constructor() {
        super();

        this.state = {
            logbooks: [],
            isEmptyLogbook: false
        }
    }

    componentDidMount() {
        let jwtToken = localStorage.getItem("JwtToken");

        fetch(`/get/logbook/${jwtToken}`, {
            method: 'GET',
            headers: {
                'Accept': 'application/json, text/plain, */*',
                'content-type': 'application/json'
            }
        }).then(response => response.json())
        .then(jsonData => {
            console.log(jsonData);
        });
    }

    showLogbooks() {
        if(this.state.logbooks.length === 0) {
            this.setState({ isEmptyLogbook: true });
        } else {
            if(this.state.isEmptyLogbook === true) {
                this.setState({ isEmptyLogbook: false });
            }
            let rowNumber = 0;
            return this.state.logbooks.map((logbook, index) => {
                return (
                    <tr>
                        <th scope="row">{++rowNumber}</th>
                        <td>{logbook.partnerName}</td>
                    </tr>
                );
            })
        }
    }

    render() {
        return (
            <div className="logbook-container">
                <div className="logbook-center">
                    <Link 
                        to="/add/dive"
                        className="add-link"
                    >
                        Add dive
                    </Link>
                </div>

                <div className="table-center table-margin">
                    <div className="table-responsive">
                        <table className="table table-hover table-striped">
                            <thead>
                                <tr className="table-success">
                                    <td scope="col">#</td>
                                    <td scope="col">Partner's name</td>
                                    <td scope="col">Partner's surname</td>
                                    <td scope="col">Entry time</td>
                                    <td scope="col">Exit time</td>
                                    <td scope="col">Location</td>
                                    <td scope="col">Average depth</td>
                                    <td scope="col">Maximum depth</td>
                                    <td scope="col">Air temperature</td>
                                    <td scope="col">Water temperature</td>
                                    <td scope="col">Diving type</td>
                                    <td scope="col">PDF</td>
                                    <td scope="col">DELETE</td>
                                </tr>
                            </thead>
                            <tbody>

                            </tbody>
                        </table>
                    </div>
                </div>
            </div>
        );
    }
}

export default Logbook;
